INSERT INTO `sl_advertise` VALUES ('1', '2018-05-10 18:59:29', '高级产品经理1', '8k-10k', '成都', '经验1-3年', '本科及以上', '全职', '<p>职位诱惑：</p><p>六险一金,弹性工作制,股票期权,饭补</p><p><br/></p><p>岗位职责：</p><p>1.负责C端、B端产品的规划与设计，包括产品架构，功能设计，制定产品优化方案；</p><p><br/></p><p>2. 负责产品市场调研、竞品分析、用户研究，提供产品的策略支持、用户验证；</p><p><br/></p><p>3. 根据用户需求和业务特征给出产品整体框架设计、功能设计、交互设计；</p><p><br/></p><p>4. 完成从产品需求分析、开发测试到正式上线的项目管理全过程；</p><p><br/></p><p>5. 跟进用户反馈、产品数据持续对产品易用性；</p><p><br/></p><p>任职要求：</p><p>1．本科及以上学历，3年以上产品设计工作经验；</p><p><br/></p><p>2.良好的产品架构设计能力，有一定交互设计或用户体验经验；</p><p><br/></p><p>3.金融基础：有一定的金融交易产品或者传统金融经纪业务背景；</p><p><br/></p><p>4.思路清晰，逻辑分析能力强，对数据敏感尤佳；</p><p><br/></p><p>5.沟通、协调、组织能力好，有较强责任心与团队精神。</p><p><br/></p><p>6.有对平台用户体验数据分析，可视化用户体验问题的现状及瓶颈；</p>', '成都 - 高新区 - 成都市高新区天府大道北段966号9号楼1层1号204房（金融梦工厂）');
