INSERT INTO `sl_articles` VALUES ('1', '2018-05-11 17:42:33', '几种装修风格分类你知道么？', '修风格分类有哪些呢？对于第一次装修的朋友来说，这个问题真的很难回答，在众多风格中哪款最适合呢？装修风格分类都有哪些？下面简单介绍几种装修风格分类供你参考。', '装修攻略', '2401', '<p><strong><span style=\"font-size: 14px;\">&nbsp; 装修风格分类有哪些呢？对于第一次装修的朋友来说，这个问题真的很难回答。其实选择什么样的装修风格是十分头疼的事，若随意装修，家居整体空间则显凌乱。家装有很多种风格，而且在实际设计中各种风格之间也可以在设计师的创意中实现融合和交叉，如果是自己自主设计的话对风格的讲究又少了一些，纯粹按照自己的喜好来装饰和设计，这也是个性的体现。而多数人装修还是会依据不同的风格的，究竟在众多风格中哪款最适合呢？</span></strong><br/></p><p style=\"white-space: normal;\"><span style=\"font-size: 14px;\"><strong>1：现代简约风格：种风格主要是运用大量的线条，使用对称或者非对称元素来设计。通常家具装修风格都是以实用为主，装饰方面也会使用金属、铁艺或者玻璃制品，通过科技与艺术的结合，彰显现代化的气息。</strong></span></p><section><p style=\"text-align: center;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526886390.jpg\" title=\"1526886390.jpg\" alt=\"timg (1).jpg\" width=\"685\" height=\"502\"/></p></section><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px;\">2:地中海风格：<span style=\"font-family: 微软雅黑; text-indent: 32px;\">地中海风情的家居装修风格，通常会使用蓝色和白色来打造清逸的海边场景，也会使用一些蓝边的贝壳海星等来装饰房间。对于不喜欢冷色调的家庭来说，有时也会使用大块的黄色来搭配，展现出海天一色阳光休闲浪漫的感觉</span></span></strong><br/></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526886754.jpg\" title=\"1526886754.jpg\" alt=\"timg (17).jpg\" width=\"687\" height=\"410\"/></span></strong></p><p style=\"white-space: normal;\"><span style=\"font-size: 14px;\"><strong>3：美式装修风格：</strong></span><strong><span style=\"font-size: 14px; color: rgb(51, 51, 51); font-family: 微软雅黑; text-indent: 32px;\"></span></strong><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\">美式乡村风格的装修源于美国西部，这种牛仔时代的家庭装修风格，力争质朴恬淡，非常的明快与舒适。</span></strong><br/></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526887148.jpg\" title=\"1526887148.jpg\" alt=\"timg (18).jpg\" width=\"687\" height=\"453\"/></span></strong></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\">4：中式风格：中式风格以深色系为主的装饰色彩上。室内多采用对称式布局，格调高雅，造型简单优美，色彩浓重而成熟。追求一种修身养性的生活境界。中国传统室内装饰艺术的特点是总体布局对称均衡，端正稳健。</span></strong></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526888146.jpg\" title=\"1526888146.jpg\" alt=\"timg (19).jpg\" width=\"686\" height=\"488\"/></span></strong></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\">5：北欧风格：北欧风格在处理空间方面一般强调室内空间宽敞、内外通透，最大限度引入自然光。在空间平面设计中追求流畅感；墙面、地面、顶棚以及家具陈设乃至灯具器皿等，均以简洁的造型、纯洁的质地、精细的工艺为其特征。</span></strong></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526888737.jpg\" title=\"1526888737.jpg\" alt=\"timg (20).jpg\"/></span></strong></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px;\">6：LOFT风格：LOFT最显著的特征是高大而开敞的空间，上下双层的复式结构，类似戏剧舞台效果的楼梯和横梁。在这空旷沉寂的空间中，弥漫着设计家和居住者的想像，他们听凭自己内心的指引，将这大跨度流动的空间任意分割，打造夹层、半夹层，设置接待区和大而开敞的办公区。</span></strong></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526889170.jpg\" title=\"1526889170.jpg\" alt=\"003G43153-0.jpg\" width=\"682\" height=\"488\"/></span></strong></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px;\">7：欧式风格：欧式风格沿袭古典欧式风格的主元素，融入了现代的生活元素。欧式的居室有的不只是豪华大气，更多的是惬意和浪漫。通过完美的曲线，精益求精的细节处理，带给家人不尽的舒服触感</span></strong></p><p style=\"white-space: normal; text-align: center;\"><strong><span style=\"font-size: 14px;\"><img src=\"http://ceshi16.dianziqingtie.com/ueditor/php/upload/image/20180521/1526889871.jpg\" title=\"1526889871.jpg\" alt=\"13231938758_w.jpg\" width=\"674\" height=\"609\"/></span></strong></p><p style=\"white-space: normal;\"><strong><span style=\"font-size: 14px; color: rgb(0, 0, 0);\"><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\">关于</span><span style=\"font-size: 14px; font-weight: 600; font-family: 微软雅黑; text-indent: 32px;\">家装风格有哪些</span><span style=\"font-size: 14px; font-family: 微软雅黑; text-indent: 32px;\">就介绍到这里了，希望对大家有所帮助。想了解更多相关知识，可以关注我们。</span></span></strong></p>', '/public/images/1526891035timg (20).jpg');
INSERT INTO `sl_articles` VALUES ('2', '2018-05-14 11:00:28', '北欧风快统治世界了！', '纵观整个家装设计领域，简约北欧风可谓火到不行，有多火呢？', '装修攻略', '2796', '<p><span style=\"color: rgb(127, 127, 127);\">近年出炉的一份中国家装消费调查报告显示：</span></p><p><span style=\"color: rgb(127, 127, 127);\">北欧风的欢迎度高达37%，已经当之无愧地成为了近两年来风靡全中国的主流装修风格。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526893012.jpg\" title=\"1526893012.jpg\" alt=\"微信图片_20180521165613.jpg\"/></p><p><span style=\"color: rgb(127, 127, 127);\">&nbsp;事实上，不止是中国，北欧风甚至已经刮到了全世界，成为在世界范围内迅速蔓延的一股“妖风”，凡是看过不少家居美图和装修案例的人，一定知道它的出镜率有多高了。</span></p><p style=\"text-align:center\"><img src=\"/ueditor/php/upload/image/20180521/1526893564.jpg\" title=\"1526893564.jpg\" alt=\"微信图片_20180521165839.jpg\" width=\"760\" height=\"1382\"/></p><p><span style=\"color: rgb(127, 127, 127);\">今天小编为大家分享一下那些越看越迷人的北欧风设计，看看它们会不会扣动你的心弦呢？</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526893783.jpg\" title=\"1526893783.jpg\" width=\"759\" height=\"1531\"/><img src=\"/ueditor/php/upload/image/20180521/1526893794.jpg\" title=\"1526893794.jpg\" width=\"1\" height=\"1\"/></p><p><span style=\"color: rgb(127, 127, 127);\">北欧家居虽然崇尚简约和清爽，多数以大面积的纯白运用为主调，甚至有人将它简单地与“性冷淡风”划等号，但它从来不会排斥其他色彩的运用。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526894177.jpg\" title=\"1526894177.jpg\" alt=\"微信图片_20180521171516.jpg\" width=\"763\" height=\"1468\"/><span style=\"color: rgb(127, 127, 127);\"><img src=\"/ueditor/php/upload/image/20180521/1526894149.jpg\" title=\"1526894149.jpg\" alt=\"微信图片_20180521171510.jpg\" width=\"1\" height=\"1\"/></span></p><p><span style=\"color: rgb(127, 127, 127);\">因为北欧地区一年中大部分是冬季，外面都是白茫茫的一片，非常寒冷，为了调剂一下自己的心情，让视觉达到平衡，他们在软装配饰上也是十分用心。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(127, 127, 127);\"><img src=\"/ueditor/php/upload/image/20180521/1526894276.jpg\" title=\"1526894276.jpg\" alt=\"微信图片_20180521171714.jpg\" width=\"755\" height=\"1469\"/><img src=\"/ueditor/php/upload/image/20180521/1526894283.jpg\" title=\"1526894283.jpg\" alt=\"微信图片_20180521171719.jpg\" width=\"751\" height=\"1450\"/><img src=\"/ueditor/php/upload/image/20180521/1526894289.jpg\" title=\"1526894289.jpg\" alt=\"微信图片_20180521171724.jpg\" width=\"764\" height=\"1457\"/></span></p><p><span style=\"color: rgb(127, 127, 127);\">以白色为主色调的基础上，恰到好处的亮色点缀，可以使整个空间看起来更加丰富与精致，平衡空间的色彩温度之余，也巧妙地营造出一种和谐自然的家居氛围。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526894448.jpg\" title=\"1526894448.jpg\" alt=\"微信图片_20180521172010.jpg\" width=\"768\" height=\"1460\"/><img src=\"/ueditor/php/upload/image/20180521/1526894456.jpg\" title=\"1526894456.jpg\" alt=\"微信图片_20180521172014.jpg\" width=\"765\" height=\"1451\"/></p><p><span style=\"color: rgb(127, 127, 127);\">北欧地区由于地处北极圈附近，一年的时间里大约有四分之一都是冬季，几个月来，他们抬起头只能看到无尽的黑夜，所以北欧人患抑郁症的几率特别高。</span></p><p><span style=\"color: rgb(127, 127, 127);\">为了释放内心的压抑，让自己可以感受到一种被阳光沐浴的感觉，大面积落地窗几乎成了北欧风的标配。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526894627.jpg\" title=\"1526894627.jpg\" alt=\"微信图片_20180521172317.jpg\" width=\"759\" height=\"1255\"/></p><p><span style=\"color: rgb(127, 127, 127);\">再加上北欧人对自然环境的热爱是超乎寻常的，他们希望在家的每个角落都能看见窗外的风景，所以习惯于选择大面积的白色、米色等浅色系来提亮空间，再在视野最好的位置开设巨大落地窗，让风景和自然光线一并纳入室内，为家居生活创造更多的幸福感。</span></p><p style=\"text-align: center;\"><span style=\"color: rgb(127, 127, 127);\"><img src=\"/ueditor/php/upload/image/20180521/1526894727.jpg\" title=\"1526894727.jpg\" alt=\"微信图片_20180521172447.jpg\" width=\"758\" height=\"1228\"/><img src=\"/ueditor/php/upload/image/20180521/1526894733.jpg\" title=\"1526894733.jpg\" alt=\"微信图片_20180521172451.jpg\" width=\"757\" height=\"1212\"/><img src=\"/ueditor/php/upload/image/20180521/1526894739.jpg\" title=\"1526894739.jpg\" alt=\"微信图片_20180521172456.jpg\" width=\"755\" height=\"1232\"/></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-size: 15px; letter-spacing: 1px; color: rgb(127, 127, 127); box-sizing: border-box !important; word-wrap: break-word !important;\">纯天然的木材是北欧风格的灵魂元素。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; max-width: 100%; clear: both; min-height: 1em; color: rgb(51, 51, 51); font-family: \"><span style=\"margin: 0px; padding: 0px; max-width: 100%; font-size: 15px; letter-spacing: 1px; color: rgb(127, 127, 127); box-sizing: border-box !important; word-wrap: break-word !important;\">北欧的森林覆盖率很高，所以他们的家居往往会采用大量的原木家具来装点。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526894886.jpg\" title=\"1526894886.jpg\" alt=\"微信图片_20180521172732.jpg\" width=\"743\" height=\"1446\"/><img src=\"/ueditor/php/upload/image/20180521/1526894892.jpg\" title=\"1526894892.jpg\" alt=\"微信图片_20180521172717.jpg\" width=\"745\" height=\"1339\"/><img src=\"/ueditor/php/upload/image/20180521/1526894898.jpg\" title=\"1526894898.jpg\" alt=\"微信图片_20180521172456.jpg\" width=\"742\" height=\"1222\"/></p><p><span style=\"color: rgb(127, 127, 127);\">北欧的家具设计还特别注重人性化的体验，它力求使设计回归到使用者的角度，造型简洁，线条流畅，更注重功能与实用性，从而呈现出一种无与伦比的高级感。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526895017.jpg\" title=\"1526895017.jpg\" alt=\"微信图片_20180521172940.jpg\" width=\"719\" height=\"1284\"/><img src=\"/ueditor/php/upload/image/20180521/1526895023.jpg\" title=\"1526895023.jpg\" alt=\"微信图片_20180521172947.jpg\" width=\"721\" height=\"581\"/><img src=\"/ueditor/php/upload/image/20180521/1526895028.jpg\" title=\"1526895028.jpg\" alt=\"微信图片_20180521172951.jpg\" width=\"720\" height=\"1317\"/></p><p><span style=\"color: rgb(127, 127, 127);\">在细节方面，每一个浑然天成的弧度，每一处装饰面上的“无收口”处理，各种材料在同一空间中的运用与穿插等，都要凭借精湛的工艺技术来完成，处处体现北欧人对于生活品质的追求。</span></p><p style=\"text-align: center;\"><img src=\"/ueditor/php/upload/image/20180521/1526895147.jpg\" title=\"1526895147.jpg\" alt=\"微信图片_20180521173130.jpg\" width=\"714\" height=\"1289\"/><img src=\"/ueditor/php/upload/image/20180521/1526895157.jpg\" title=\"1526895157.jpg\" alt=\"微信图片_20180521173136.jpg\" width=\"712\" height=\"1339\"/></p><p><span style=\"color: rgb(127, 127, 127);\">总之，北欧风之所以如此风靡，不仅仅得益于它本身的功能实用、回归自然和以人为本，最主要的是，它彰显了一种简单自然但又不乏品位的生活态度。</span></p>', '/public/images/1526895379微信图片_20180521170315.jpg');
INSERT INTO `sl_articles` VALUES ('3', '2018-05-14 11:00:28', '家庭装修壁纸种类 4种类型打造不一样墙壁效果', '现如今，很多人因为厌倦了涂刷墙壁的繁琐工序和经过一段时间的使用后墙体脱落带来的烦恼，渐渐以壁纸取代它们来装饰家居，那么，常见的家庭装修壁纸种类有哪些呢?接下来，小编就给大家介绍4种热门壁纸吧。', '装修攻略', '0', null, null);
