INSERT INTO `sl_articles` VALUES ('77', '2018-05-14 11:26:55', '装修知识', '现如今，很多人因为厌倦了涂刷墙壁的繁琐工序和经过一段时间的使用后墙体脱落带来的烦恼，渐渐以壁纸取代它们来装饰家居，那么，常见的家庭装修壁纸种类有哪些呢?接下来，小编就给大家介绍4种热门壁纸吧。11111111111111', '家装选材', '26', '<p><img src=\"/ueditor/php/upload/image/20180514/1526279247250617.jpg\" title=\"1526279247250617.jpg\" alt=\"xuatangxiangqing.jpg\"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;四川新闻网德阳5月13日讯（记者 周鸿）5月13日，有市民反映，绵竹一老人找不到家，求助民警，却遭遇该民警的拒绝，而且态度也不友好。5月13日下午，绵竹市公安局发布微博表示，该民警在处警过程中存在言语、行为不规范，方法简单粗暴等问题，已被停止执行职务接受进一步调查。</p><p>　　据一段9秒钟的视频显示，晚上一位老大爷因为找不到回家的路，便向坐在警车里面的一位民警求助。不过，该民警却称：“本身找人就不该我们找”。接着，旁边的一位女士对该民警说，这个老大爷找不到家了，你们可不可以帮一下。</p><p>　　还没等旁边的女士说完，该民警抢过话来称，老大爷找不到家可以找他儿子，“管我们啥子事。”接着，该民警用右手直接拍向拍摄者手中的摄影器材（应该是手机）。</p><p>　　5月13日下午，绵竹市公安局官方微博对此事进行了通报。微博称：5月12日22：01，绵竹市公安局城中派出所民警接指挥中心指令到剑南镇针织巷口救助一名酒后迷失老人，民警及时赶到现场处置，并于当晚22：35将该老人安全送至回澜社区小区家中，但处警过程中处警不规范被网友曝光。</p><p>　　绵竹市公安局12日23：08发现该事件，高度关注，局纪委、督察部门第一时间展开调查。13日09：50与报警群众见面核实情况并取得理解、支持。</p><p>　　经初查，民警在处警过程中存在言语、行为不规范，方法简单粗暴等问题。绵竹市公安局将结合正在开展的纪律作风教育整顿活动，针对当事民警语言不文明、执法不规范行为作出严肃处理。</p><p>　　目前，当事民警已被停止执行职务接受进一步调查。感谢广大群众对绵竹市公安局工作的监督和支持。</p>', '/public/images/1526269638baozhanglist_11.jpg');
