INSERT INTO `sl_case` VALUES ('1', '2018-05-16 00:07:04', 'HT峰荟花园林先生的新家', '谷栗装饰', '2', '1', '1', '/public/images/1526400424fangandetail_03.jpg', '高阳', '成都', '3.5', '半包', '105', '油漆阶段', '案中地中海的颜色以蓝白为主色调，连续的拱形、栅栏式的窗户、实木为主的家具和低色调的棉织物为主加上地中海独特的软装饰品，给人感觉无比舒适。以简约色调、光影为主，没有城市那么华丽，有的只有安静，这就是生活，生活也就莫过于此', '<h2 class=\"biaoti\" style=\"margin: 0px 0px 24px; padding: 0px; font-weight: 500; font-size: 18px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: 20px; font-family: pfb; color: rgb(51, 51, 51); white-space: normal;\"><strong>原始结构图</strong></h2><p><img src=\"/ueditor/php/upload/image/20180516/1526406032212404.jpg\" title=\"1526406032212404.jpg\" alt=\"fangandetail_07.jpg\"/></p><p>简洁明亮的客厅，搭配黄蓝撞色的皮布沙发。布沙发是Angela的专属位子，当然皮沙发它是不能上去的。沙发背景墙上的灰白画也很好地填补了视觉的空洞。</p><p><br/></p><p><strong>平面结构图</strong></p><p><strong><img src=\"/ueditor/php/upload/image/20180516/1526406070874922.jpg\" title=\"1526406070874922.jpg\" alt=\"fangandetail_11.jpg\"/></strong></p><p>简洁明亮的客厅，搭配黄蓝撞色的皮布沙发。布沙发是Angela的专属位子，当然皮沙发它是不能上去的。沙发背景墙上的灰白画也很好地填补了视觉的空洞。</p>');
