INSERT INTO `sl_house` VALUES ('1', '2018-05-14 15:12:38', '堰山河畔  品质小区 中间楼层 看房有钥匙', '精装修，双证在手满三年，中间楼层，采光通风都很不错，小区环境优越，绿化面积大。', '堰山河畔', '黄金8楼(共18层)蒲阳河畔', '2013', '平层', '123', '南北', '平层', '10000.00', '123.00', '50.00', '10000.00', '都江堰市', '<p>1、此房位于都江堰蒲阳河畔，房东目前因工作原因，移居外地，考虑工作地点购房，现在换房诚心出售此房屋！</p><p>2、此房装修精致，现代简约式的装修风格，大气、简单，适合任何年龄阶层的人。</p><p>3、此房家居、家电齐备，房东以半赠送的形式出售。</p><p>4、此房可以做按揭。</p><p><br/></p>', '幼儿园：都江堰市商业局幼儿园、都江堰市爱心亲子园、光亚幼儿园、金苹果幼儿园、新加坡景兰幼儿园中小学：都江堰市北街小学、育才中学、都江堰市外国语实验学校、顶新新建小学、光亚学校大学：成都大学都江校区、四川农业大学都江堰分校、东北大学东软信息技术学院商场：红旗连锁，红艳超市，世纪华联超市医院：人民医院、水电十局医院邮局：中国邮政农大都江堰校区邮政所：中国、交通、建设其他：二环路美食街小区内部配套：小区内部有健身设施，绿化景观', '本人从事房地产多年，公司有大量好房源，欢迎进入我的店铺查看，欢迎随时电话，相信我的专业，为您置业安家保驾护航。', '3', '2', '2', '/public/images/1527155943u=4216408679,4228190134&fm=11&gp=0.jpg', '/public/webuploader/upload/file_2018052487907u=4216408679,4228190134&amp;fm=11&amp;gp=0.jpg,/public/webuploader/upload/file_20180524599272e4fd936454997c7db4c1d8bbbb8.jpg.2000x560.jpg', '精装');
INSERT INTO `sl_house` VALUES ('2', '2018-05-14 16:04:47', '滨江西路 世代锦江 凯旋门 中间楼层 看房有钥匙', '此房双证在手，房屋产权满2年，中间楼层，采光通风都很不错', '时代靖江凯旋门', '中楼层(共29层)2008年建塔楼 - 盐市口', '2013', '别墅', '219', '南北', '地下（共2层）', '565623.00', '30.00', '390.00', '565623.00', '高新区', '<p>欢迎光临谷粟网</p><p>此房源为浦秀路东进门左手边第三排靠景观位置，产证面积219平1300万出售，产权1个人，里面没有户口，买进价800万，还有200万的银行贷款，房型结构：</p><p>一楼：超大客厅，厨房餐厅格局分明。一个朝北的房间，厨卫朝北，带室内电梯</p><p>二楼：奢敞主人套房，是为居主不受打扰，豪华主卧套间舒适怡人，独立，步入式衣帽间完备配置；主人房外连大面积景观露台，无论静心阅读，赏景观物皆可自成一趣</p><p>阁楼：层高3.2米，大约80平左右，</p><p>地下室一层，面积120平，二层，车库可以停两部车</p><p>3.花园朝南约150平，全景落地窗，采光好、私家庭院，</p><p><br/></p>', '交通状况： 公交：174（康桥站）、986（漕河泾出口*区）、163（漕河泾出口*区）、闵行12路（浦锦路陈行路站）、浦江4路（浦锦路陈行路站）', '2013年3月从事这行工作，一直关注上海豪宅的买卖，范围涵盖整个上海的别墅、江景房、洋房；对浦东的别墅和江景房尤为熟悉。成交小区：前滩一号 +尚东鼎+美林别墅+华侨城+万科提香别墅  做豪宅买卖整整5年，主营别墅小区基本都有成交买卖单，积累了较多的豪宅买卖经验。精准定位，以需找房，用心服务。客户满意开心是对我*的动力！*：', '4', '3', '2', '/public/images/1527211463timg.jpg', '/public/webuploader/upload/file_20180525575721.jpg', null);
