INSERT INTO `sl_serve` VALUES ('1', '2018-05-11 17:00:16', '平台保障', '<p>为客户免费提供一对一商务咨询服务。</p><p>为客户提供便捷，舒心，安全的家居互联网服务平台</p><p>为客户提供全程跟踪陪同线下体验店体验服务</p><p>为客户提供优质的项目保障，确保消费者合法权益，全程平台方进行监督和管理</p><p><br/></p>', 'PLATFORM', '/public/images/1526029488baozhangpng1.png', '/public/images/1526030680baozhanglist_15.jpg');
INSERT INTO `sl_serve` VALUES ('2', '2018-05-11 17:05:52', '安全保障', '<p>为客户提供专业、安全、持续、超值的服务。</p><p>第三方监管体降低客户风险。</p><p>提供全方面的监理验收服务，保障客户有效权益。</p>', 'SAFE', '/public/images/1526029552baozhangpng2.png', '/public/images/1526030659baozhanglist_11.jpg');
INSERT INTO `sl_serve` VALUES ('3', '2018-05-11 17:06:58', '法律保障', '<p>平台方依法行使客户权益，保障客户合法利益。</p><p>第三方监督管理，全部参照国家行业标准执行。</p><p>签定正式项目合作合同，确保三方互惠、合作共赢。<br/></p><p><br/></p><p><br/></p><p><br/></p>', 'LAW', '/public/images/1526029618baozhangpng3.png', '/public/images/1526030643baozhanglist_07.jpg');
INSERT INTO `sl_serve` VALUES ('4', '2018-05-11 17:07:46', '资金保障', '<p>平台第三方资金监管，确保客户本质利益。</p><p>第三方资金托管体系，让每一分钱都花在刀刃上。<br/></p><p>全透明式资金监管，客户更放心。</p>', 'FUND', '/public/images/1526029666baozhangpng4.png', '/public/images/1526030622baozhanglist_03.jpg');
