INSERT INTO `sl_tuandui` VALUES ('1', '2018-05-15 22:55:50', '高阳', 'sdsasasa', '精英团队', '5', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">刘晓丽毕业于西华大学，专业：观光农业。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">在内地及香港地区具有十五年的从业经验，于2007年创建SMY(成都设计机构)。在这期间致力于发展内地市场，并将SMY在内地的企业打造成为极具创意性的综合商业设计的团队。多年来和中国室内设计协会，四川省地产企业协会，成都饭店协会进行过多次系列交流，向相关业界介绍了大量国际先进设计理念。得到地产界、酒店界、设计界的广泛认同，并在随后几年成为相关业界的风向标。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">6年从业经验，致力于酒店、高级会所、别墅、样板间等项目的软装设计，设计过多个项目，赢得了众多客户的认可及好评。具有良好的色彩感觉、时尚触觉、视觉语言表达能力，善于搭配摆设，常常能在准确和较高可行性的工作前提下，为设计方案带来创新性思考。</p>', '/public/images/1526398401shejituandui_12.jpg');
INSERT INTO `sl_tuandui` VALUES ('2', '2018-05-15 23:29:09', '高阳2', 'sdsasasa', '精英团队', '5', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">刘晓丽毕业于西华大学，专业：观光农业。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">在内地及香港地区具有十五年的从业经验，于2007年创建SMY(成都设计机构)。在这期间致力于发展内地市场，并将SMY在内地的企业打造成为极具创意性的综合商业设计的团队。多年来和中国室内设计协会，四川省地产企业协会，成都饭店协会进行过多次系列交流，向相关业界介绍了大量国际先进设计理念。得到地产界、酒店界、设计界的广泛认同，并在随后几年成为相关业界的风向标。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 14px 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 14px; line-height: 28px; font-family: pfr; color: rgb(102, 102, 102); white-space: normal;\">6年从业经验，致力于酒店、高级会所、别墅、样板间等项目的软装设计，设计过多个项目，赢得了众多客户的认可及好评。具有良好的色彩感觉、时尚触觉、视觉语言表达能力，善于搭配摆设，常常能在准确和较高可行性的工作前提下，为设计方案带来创新性思考。</p>', '/public/images/1526408006shejituandui_03.jpg');
