INSERT INTO `sl_zxgs` VALUES ('1', '2018-05-15 16:43:07', '谷栗装饰', '2', '1', '1', '123', '都江堰东能财富广场903', '<p style=\"text-indent: 32px; text-align: justify;\"><span style=\"font-family: 微软雅黑, \">“谷栗网O2O互联网家装/工装信息服务平台”项目是将线下装饰公司、个体施工队伍、材料商家、设计团队、个人设计师进行全面整合到平台上，由平台为入驻商家提供店铺服务、产品展示服务、营销推广等服务。平台同时对入驻商家进行实时监督，确保平台的透明化、规范化以及秩序化。在线上平台主要建立PC端口、移动端口、微信端口等受众面较广的营销端口开展引流及推广，在线下平台将不定期组织平台入驻商家开展各类营销活动，进行线下市场拓展及推广，确保平台入驻商家在线上及线下的双重利益。</span></p>', '275', '/public/images/1527141997谷栗网定稿2.jpg', '公司总面积1200余平方米，材料展厅面积800余平方米，办公服务厅400余平方米，现有员工60余人，年销售额1.2亿元。', '公司严格按照国家相关标准执行售后服务，提供7x24小时上门服务等。', '公司提供免费的方案设计和预算报价', '根据客户的风格喜好和个性化设计预算出合理的价格提供给客户参考', null, null, null, null, null, null, null, null, null, null, '/public/images/1527154525f852c72ade5b960a1788f9f56d9f09ef.jpg', '200', '300', '100');
